"use strict";(self.webpackChunkexonumia_cc=self.webpackChunkexonumia_cc||[]).push([[20001],{3788:(a,e,o)=>{o.r(e),o.d(e,{data:()=>l});const l={key:"v-dc7558c0",path:"/zaf/nso/bitcoin-is-like-sports/",title:"Bitcoin e swana le dipapadi",lang:"nso",frontmatter:{supporters:[{name:"HRF",href:"https://bitcoinmagazine.com/business/hrf-gifts-4-bitcoin-to-bitcoin-projects"}],translators:[{name:"Nobuhle Ratlhagana",href:"https://twitter.com/NRatlhagana"}]},excerpt:"",headers:[],filePathRelative:"zaf/nso/bitcoin-is-like-sports/README.md",git:{updatedTime:1761164621e3}}},81140:(a,e,o)=>{o.r(e),o.d(e,{default:()=>b});var l=o(66252);const t=(0,l._)("h1",{id:"bitcoin-e-swana-le-dipapadi",tabindex:"-1"},[(0,l._)("a",{class:"header-anchor",href:"#bitcoin-e-swana-le-dipapadi","aria-hidden":"true"},"#"),(0,l.Uk)(" Bitcoin e swana le dipapadi")],-1),n=(0,l.Uk)("Mongwadi ke @thebitcoinrabbi "),g={href:"https://twitter.com/thebitcoinrabbi/status/1349445548500262916",target:"_blank",rel:"noopener noreferrer"},i=(0,l.Uk)("2021/01/13"),r=(0,l.uE)("<p>Ka dinako tše dingwe ke fela ke hlaloša gore #bitcoin e šoma bjang ebile e fetotšwe go kamano ya moraloko ya dipapadi. Ke hweditše gore se se thuša go araba dipotšišo tše dintšhi tšeo di tlwaelo:</p><p>Potšišo: Ke mang a tlilego ka papadi ya kgwele ya maoto?<br> Karabo: Seo ga se naplie se le bohlokwa. Motho mang le mang mo lefaseng a ka kgona go e raloka. Ga go na taba ge mothomi wa yona a ka nyaka go fetola melao goba go ipha meputso goba ka tsela efe goba efe. Ga re na taba le gore o nagana eng ka papadi ya rena.</p><p>Potšišo: Ke mang a laolago moraloko?<br> Karabo: Ga se motho, ka moka ga rena re dio ikgethela go e raloka. Ka moka ga rena re tseba le go šomiša melao, ebile ge yo mongwe a re hlalefetša, re kgona go ba ntšha mo papading. Ge yo mongwe a ipha meputso yeo e sa mo swanelago, re e dira eke ga re mmone.</p><p>Potšišo: Re tseba bjang gore melao e ka se fetoge?<br> Karabo: Ka moka ga rena re dumelelane ka yona ge re thoma go raloka, le motho mang le mang yo a nyakago go tšwela pele ka go raloka ka melao ye o sa tlile go tšwela pele ka go raloka, ebile ge yo mongwe a nyaka go e fetola, go tlile go hlokega gore a ye go ralokela ko gongwe.</p><p>Potšišo: E ka kgona go tsenega ka moo go sego molaong?<br> Karabo: Se sengwe le se sengwe se phatlaladitšwe gore setšhaba se se bone. Ka moka re kgona go bona molala le lohle le dino ka moka. Ge go na le yo a be a hlalefetša ba bangwe, re tlile go tseba gomme ra mo raka.</p><p>Potšišo: Gobaneng e le bohlokwa?<br> Karabo: Ka moka re tšere sephetho sa go raloka, se se a bontšha gore e bohlokwa go rena ka tsela yeo e itšego. Ge yo mongwe a nyaka go raloka le rena, ba tlile go swanelwa ke go dumelelana le go amogela mohola le dintlha tša rena.</p><p>Ke a o bona mohola wa yona, bjale ke a dumela gore e na le mohola. Mohola o kgetha lehlakore.</p><p>Potšišo: E ka se thibelwe?<br> Karabo: Mohlomongwe, eupša e dio ba batho fela bao ba ithalokelago kgwele ka maoto, ebile ga ba kweše motho bohloko, ke mmušo fela woo o ka ba emišago gore ba tlogele go e raloka, eupša ba ka se thibele kgopolo ya go raga kgwele ka maoto, papadi e tlile go tšwela pele ko gongwe.</p><p>Potšišo: Nka raloka le lena?<br> Karabo: Dira seo o se nyakago. Ke a ipšhina ka go raloka kgwele ya maoto, o ka raloka le rena goba wa Ipšhina ka go phela o Sokola.</p>",9),k={},b=(0,o(83744).Z)(k,[["render",function(a,e){const o=(0,l.up)("OutboundLink"),k=(0,l.up)("LanguageDropdown");return(0,l.wg)(),(0,l.iD)(l.HY,null,[t,(0,l._)("p",null,[n,(0,l._)("a",g,[i,(0,l.Wm)(o)])]),(0,l.Wm)(k),r],64)}]])},83744:(a,e)=>{e.Z=(a,e)=>{const o=a.__vccOpts||a;for(const[a,l]of e)o[a]=l;return o}}}]);